export const getSearch = async ({ start, end }) => {
  let body = raw
  .replace("ctl00%24Conteudo%24txtDataInicioPesquisa=01%2F2010", `ctl00%24Conteudo%24txtDataInicioPesquisa=${start}`)
  .replace("ctl00%24Conteudo%24txtDataFimPesquisa=12%2F2010", `ctl00%24Conteudo%24txtDataFimPesquisa=${end}`)

  var requestOptions = {
    method: 'POST',
    headers: myHeaders,
    body: body,
    redirect: 'follow'
  };
  const request = await fetch("http://informacoesbmp.aneel.gov.br/ConsultarBMPAberto.aspx", requestOptions)
  .then(response => response.text())
  .catch(error => console.log('error', error));

  const viewState = /__VIEWSTATE\|\/.+(?<!=)=(?!=)/.exec(request)?.[0].replace("__VIEWSTATE|", "")
  const eventValidation = /__EVENTVALIDATION*.+==/gm.exec(request)?.[0].replace("__EVENTVALIDATION|", "")

  return { viewState, eventValidation };
}
